import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from 'react-router-dom';

// Import components for each page
import Lab7 from './Lab7/page';
//import Lab8 from './Lab8/page';
//import AboutMe from './pages/Lab9/AboutMe';
//import Interests from './pages/Lab9/Interests';
//import Favorite from './pages/Lab9/Favorite';
//import Contact from './pages/Lab9/Contact';
import NotFound from './404/page';

function App() {
  return (
    <Router>
      <Routes>
        {/* Routes for Lab 7 and Lab 8 */}
        <Route path="/lab7" element={<Lab7 />} />


        {/* Routes for Lab 9 with subpages */}


        {/* Redirect unknown routes to the NotFound page */}
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  );
}

export default App;
